import React, { Component } from 'react'
import { getGuides } from '../../service/api'

export default class List extends Component {
     state = {
          guides: []
     }

     componentDidMount() {
          getGuides()
               .then(response => {
                    this.setState({
                         guides: response.data
                    });
               });
     }

     render() {
          return (
               <div>
                    {this.state.guides[0].title}
               </div>
          )
     }
}
